package main

import "fmt"

func floor(str string) int {
	count := 0
	var result []int
	for i, ch := range str {
		if ch == '(' {
			count++
		} else if ch == ')' {
			if count == -1 {
				result = append(result, i)
			}
			count--
		}
	}
	fmt.Println(result)
	return count
}

